%hive
DROP VIEW IF EXISTS v1_final;

CREATE VIEW v1_final AS
select * from v1 where pickup_cell_latitude <= 300 and pickup_cell_longitude <= 300 and dropoff_cell_latitude <= 300 and dropoff_cell_longitude <= 300;

%hive
DROP VIEW IF EXISTS tuples;

CREATE VIEW tuples AS
SELECT medallion, fare_amount, tip_amount, pickup_datetime, dropoff_datetime, concat('(', cast(pickup_cell_latitude AS string), ',', cast(pickup_cell_longitude AS string), ')') AS pickup_cell, concat('(', cast(dropoff_cell_latitude AS string), ',', cast(dropoff_cell_longitude AS string), ')') AS dropoff_cell, concat('(', cast(pickup_cell_latitude AS string), ',', cast(pickup_cell_longitude AS string), ') , (', cast(dropoff_cell_latitude AS string), ',', cast(dropoff_cell_longitude AS string), ')') AS trip, pickup_week_day, dropoff_week_day
FROM v1_final;

DROP TABLE IF EXISTS Q1_FINAL_TABLE;

CREATE TABLE Q1_FINAL_TABLE AS
select trip, translate(split(trip, ",")[0], "(", "") as pickup_cell_latitude, translate(split(trip, ",")[1], ")", "") as pickup_cell_longitude, translate(split(trip, ",")[2], "(", "") as dropoff_cell_latitude, translate(split(trip, ",")[3], ")", "") as dropoff_cell_longitude, count(*) AS count
from tuples
GROUP BY trip
ORDER BY count desc;

DROP TABLE IF EXISTS Q1_FINAL_TABLE_MON;

CREATE TABLE Q1_FINAL_TABLE_MON AS
select trip, translate(split(trip, ",")[0], "(", "") as pickup_cell_latitude, translate(split(trip, ",")[1], ")", "") as pickup_cell_longitude, translate(split(trip, ",")[2], "(", "") as dropoff_cell_latitude, translate(split(trip, ",")[3], ")", "") as dropoff_cell_longitude, count(*) AS count
from tuples
where pickup_week_day = 1 and dropoff_week_day = 1
GROUP BY trip
ORDER BY count desc;

