%hive
DROP VIEW IF EXISTS Q2_VIEW_1;

CREATE VIEW Q2_VIEW_1 AS
SELECT pickup_cell, avg(fare_amount + tip_amount) AS avg_fare_tips
From tuples
GROUP BY pickup_cell;

SELECT * from Q2_VIEW_1;

%hive
DROP VIEW IF EXISTS empty_taxi_dropoff_view;

CREATE VIEW empty_taxi_dropoff_view AS
SELECT medallion, dropoff_cell AS cell, dropoff_datetime, from_unixtime(unix_timestamp(dropoff_datetime) + 15 * 60) AS dropoff_datetime_plus_15
FROM tuples;

DROP VIEW IF EXISTS empty_taxi_pickup_view;

CREATE VIEW empty_taxi_pickup_view AS
SELECT medallion, pickup_cell AS cell, pickup_datetime
FROM tuples;

DROP TABLE IF EXISTS empty_taxi_dropoff;

CREATE TABLE empty_taxi_dropoff
(
	dropoff_medallion		    string,
	dropoff_cell		string,
	dropoff_datetime	timestamp,
	dropoff_datetime_plus_15	timestamp
);

ALTER TABLE empty_taxi_dropoff SET FILEFORMAT orc;

INSERT OVERWRITE TABLE empty_taxi_dropoff SELECT * FROM empty_taxi_dropoff_view;

DROP TABLE IF EXISTS empty_taxi_pickup;

CREATE TABLE empty_taxi_pickup
(
	pickup_medallion		    string,
	pickup_cell		string,
	pickup_datetime	timestamp
);

ALTER TABLE empty_taxi_pickup SET FILEFORMAT orc;

INSERT OVERWRITE TABLE empty_taxi_pickup SELECT * FROM empty_taxi_pickup_view;

