DROP VIEW IF EXISTS Q2_VIEW_2;

CREATE VIEW Q2_VIEW_2 AS
select * from mytable;

select * from Q2_VIEW_2;

%hive

DROP VIEW IF EXISTS Q2_FINAL_VIEW;

CREATE VIEW Q2_FINAL_VIEW AS
SELECT Q2_VIEW_1.pickup_cell, Q2_VIEW_1.avg_fare_tips/Q2_VIEW_2.empty_taxis AS profit
FROM Q2_VIEW_1 JOIN Q2_VIEW_2 ON (Q2_VIEW_1.pickup_cell = Q2_VIEW_2.cell);

DROP TABLE IF EXISTS Q2_FINAL_TABLE;

CREATE TABLE Q2_FINAL_TABLE AS
SELECT pickup_cell as cell, 41.474937-(cast(translate(split(pickup_cell, ",")[0], "(", "") as float) - 1)*0.004491556 as cell_latitude, (cast(translate(split(pickup_cell, ",")[1], ")", "") as float) - 1)* 0.005986 - 74.913585 as cell_longitude, profit FROM Q2_FINAL_VIEW
ORDER BY profit desc
LIMIT 10;

SELECT * FROM Q2_FINAL_TABLE;

