%hive
DROP TABLE IF EXISTS Q3_NEAR_MAN;

CREATE TABLE Q3_NEAR_MAN AS
select trip, translate(split(trip, ",")[0], "(", "") as pickup_cell_latitude, translate(split(trip, ",")[1], ")", "") as pickup_cell_longitude, translate(split(trip, ",")[2], "(", "") as dropoff_cell_latitude, translate(split(trip, ",")[3], ")", "") as dropoff_cell_longitude
from tuples;

DROP TABLE IF EXISTS Q3_NEAR_MAN_FINAL;

CREATE TABLE Q3_NEAR_MAN_FINAL AS
select trip, translate(split(trip, ",")[0], "(", "") as pickup_cell_latitude, translate(split(trip, ",")[1], ")", "") as pickup_cell_longitude, translate(split(trip, ",")[2], "(", "") as dropoff_cell_latitude, translate(split(trip, ",")[3], ")", "") as dropoff_cell_longitude, count(*) as count
from Q3_NEAR_MAN
where (cast(pickup_cell_latitude as float) < 178 and cast(dropoff_cell_latitude as float) < 178 and cast(pickup_cell_latitude as float) > 134 and cast(dropoff_cell_latitude as float) > 134
and cast(pickup_cell_longitude as float) > 151 and cast(dropoff_cell_longitude as float) > 151 and cast(pickup_cell_longitude as float) < 169 and cast(dropoff_cell_longitude as float) < 169)
GROUP BY trip
ORDER BY count desc;

%hive
DROP TABLE IF EXISTS Q3_NEAR_MAN_FINAL_TOP;

CREATE TABLE Q3_NEAR_MAN_FINAL_TOP AS
select trip, 41.474937-(pickup_cell_latitude - 1)*0.004491556 as p_cell_latitude, (pickup_cell_longitude - 1)* 0.005986 - 74.913585 as p_cell_longitude, 41.474937-(dropoff_cell_latitude - 1)*0.004491556 as d_cell_latitude, (dropoff_cell_longitude - 1)* 0.005986 - 74.913585 as d_cell_longitude
from Q3_NEAR_MAN_FINAL
LIMIT 10;

